import React from 'react'

function Info({props}){
    return(
        <div className="main__inner">
            <div>{text1}</div>
            <div>{text2}</div>
            <div>{text3}</div>
            <div>{text4}</div>
        </div>
    );
}

function MainCont() {
  return (
    <section className="main__cont">
        <Info 
            text1="we provide"
            text2="visual coding"
            text3="solution"
            text4="for you webs"
        />
    </section>
  )
}

export default MainCont
